import { useEffect } from "react";
import {
    BrowserRouter, Route, Routes, useNavigate,
  } from 'react-router-dom';
import UserID from "./UserID";

const Spotify = () => {
    
    const navigate = useNavigate();

    useEffect(() => {

        const fetchData = async () => {
            // get the data from the api
            const sessionData = await fetch('/survey');
            // convert data to json
            const json = await sessionData.json();
            
            return json

          }
        let didCancel = false;
        const goToHomePage = () => navigate('/userid');
        if (!didCancel) { goToHomePage(); }
        const sessionData = fetchData()
        if(sessionData){
            console.log("fasdf")
        }
    })


    return ( 
        <h1>This is the spotify page</h1>
     );
}
 
export default Spotify;
